import React from "react";

export const Title_itemsOfList = (props) => {
  const { item } = props;
  return (
    <div className="">
      <li className="d-flex justify-content-center align-items-center">
        <span className="p-5 items_of_sidebar_list d-none text-light titleStyle">
          {item}
        </span>
      </li>
    </div>
  );
};
